  false,\n\t\"url\": null,\n\t\"notes\": \"Conductivity Temperature and Depth (CTD)
  measurements were collected aboard the NOAA Ship Pisces to determine physical oceanographic
  parameters of the water column, and in some cases used to help guide sample collection
  as part of the Deepwater Horizon oil spill sampling effort. Temperature, conductivity/salinity,
  depth, dissolved oxygen, and fluorometry data were collected onboard the NOAA Ship
  Pisces. The final product is a series of NetCDF files containing every CTD cast
  that has been processed and quality checked.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
